	add("petard", "{\"term\":\"petard\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027petarder\u0027 see \u0027pétard\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small, hat-shaped explosive device, used to blow a hole in a door or wall\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Anything potentially explosive, in a non-literal sense\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Shakespeare, \u0027Hamlet\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"For tis the sport to haue the enginer / Hoist with his owne \u0027\u0027petar\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A loud firecracker\", \"priority\":5}]}, \"synonyms\":{}}");

	add("peter", "{\"term\":\"peter\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027petrus\u0027 from Ancient greek (to 1453) \u0027πέτρος\u0027 from \u0027πέτρος\u0027 (stone, rock) related to \u0027πέτρα\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1911\u0027\u0027 w:J. M. J. M. Barrie, \u0027w:Peter Peter Pan\u0027, Wordsworth Editions Ltd, 1993, Chapter\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"She knew of no \u0027\u0027Peter\u0027\u0027, and yet he was here and there in John and Michael\u0027s minds, while Wendy\u0027s began to be scrawled all over with him. The name stood out in bolder letters than any of the other words, and as Mrs Darling gazed she felt that it had an oddly cocky appearance\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1933\u0027\u0027 w:Eleanor Eleanor Farjeon, \u0027Over the Garden Wall\u0027,Faber and Faber 1933, page 90 (\u0026quot;Boys\u0027 Names\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"What splendid names for boys there are! / There\u0027s Carol like a rolling car, / And Martin like a flying bird, / And Adam like the Lord\u0027s First Word, / And Raymond like the Harvest Moon, / And \u0027\u0027Peter\u0027\u0027 like a piper\u0027s tune\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The leading Apostle in the New Testament\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"And I say unto thee, That thou art \u0027\u0027Peter\u0027\u0027, and upon this rock I will build my church\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The epistles of Peter in the New Testament of the Bible, 1 Peter and 2 Peter attributed to St. Peter\", \"priority\":7}]}, \"synonyms\":{}}");

	add("petechia", "{\"term\":\"petechia\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Italian\"], \"text\":\"From from Italian \u0027petecchie\u0027 (skin eruptions) from a popular Latin diminutive of \u0027petigo\u0027 (scab, eruption) (from \u0027impetīgo\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small spot, especially on an organ, caused by bleeding underneath the ski\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, Patrick O’Brian, \u0027HMS Surprise\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It is scurvy. All my authorities agree – weakness, diffused muscular pain, \u0027\u0027petechia\u0027\u0027, tender gums, ill breath – and M’Alister has no doubt of it\", \"priority\":3}]}, \"synonyms\":{}}");

	add("pethidine", "{\"term\":\"pethidine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027piperidine\u0027 + {{suffix|ethyl|idine|alt1\u003deth(yl)|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fast-acting opioid analgesic drug used in the treatment of severe pain\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0027Super-Cannes\u0027, Fourth Estate 2011, p. 125\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Inside was a clutter of prescription pads and a carton containing a collection of diamorphine syrettes and a dozen ampoules of \u0027\u0027pethidine\", \"priority\":3}]}, \"synonyms\":{}}");

	add("petiole", "{\"term\":\"petiole\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027pétiole\u0027 and its source, Latin \u0027petiolus\u0027 (little foot) diminutive form of \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The stalk of a leaf, attaching the blade to the stem\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A narrow or constricted segment of the body of an insect. Used especially to refer to the metasomal segment of Hymenoptera such as wasps\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The stalk at the base of the nest of the paper wasp\", \"priority\":3}]}, \"synonyms\":{}}");

