	add("petrichor", "{\"term\":\"petrichor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027petro-\u0027 + \u0027ichor\u0027 The word was coined by scientists Isabel Joy Bear (Australian) and Richard Thomas (British) in their 1964 article \u0026quot;Nature of Argillaceous Odour\u0026quot;, published in the journal \u0027{{w|Nature (journal)|Nature}}\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The distinctive scent which accompanies the first rain after a long warm dry spell\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Val Panesar, \u0027For the Sake of the Future\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Though it had yet to begin raining, the familiar smell of \u0027\u0027petrichor\u0027\u0027 appeared to be already present and Neelam suddenly wished she was sitting at home with a nice cup of tea and a good book\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The yellow organic oil that yields this scent\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1980\u0027\u0027, John E Bardach et al., \u0027Fish Behavior and its Use in the Capture and Culture of Fishes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He hypothesizes that this factor may be \u0027\u0027petrichor\u0027\u0027, an oil which has been isolated from silicate minerals and rocks [...].Category:en:Scents\", \"priority\":6}]}, \"synonyms\":{}}");

	add("petrification", "{\"term\":\"petrification\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"middle french (ca. 1400-1600)\"], \"text\":\"From French \u0027pétrification\u0027 from Middle french (ca. 1400-1600) \u0027pétrifier\u0027 + \u0027-ation\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the process of replacing the organic residues of plants (and animals) with insoluble salts, the original shape and topography being retaine\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"obduracy; callousnes\", \"priority\":2}]}, \"synonyms\":{}}");

