	add("petrol", "{\"term\":\"petrol\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027(essence de)\u0027 \u0027pétrole\u0027 from \u0027petroleum\u0027 from Ancient greek (to 1453) \u0027πετρέλαιον\u0027 (lang\u003dgrc) from \u0027πέτρα\u0027 (lang\u003dgrc) \u0027ἔλαιον\u0027 (lang\u003dgrc)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Petroleum, a fluid consisting of a mixture of refined petroleum hydrocarbons, primarily consisting of octane, commonly used as a motor fuel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1987\u0027\u0027 October 29, Advertisement, \u0027w:New New Scientist\u0027, %22petrols%22+-intitle:%22petrol%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnNfWT67gJMaWiQf02JyRAw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"%22petrols%22%20-intitle%3A%22petrol%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 31\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"We were the first company to introduce unleaded \u0027\u0027petrol\u0027\u0027 in Britain, opening our first pump in June 1986\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027 September 27, \u0027Congressional Record: Proceedings and Debates of the 106th Congress, Second Session\u0027, Volume 146, Part 14, %22petrols%22+america|american+-intitle:%22petrol%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dluDWT_KnO66OiAf0qeCMAw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"%22petrols%22%20america|american%20-intitle%3A%22petrol%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 19605\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"European oil firms are beginning to follow the example of their American counterparts by adding convenience stores to their pumps: the typical American \u0027\u0027petrol\u0027\u0027 station now makes some 40 percent of its profits from the sale of non-oil products, such as cigarettes and beer\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, S. Srinivasan, \u0027Automotive Mechanics\u0027, Tata McGraw Hill, India, 2nd Edition, %22petrols%22+-intitle:%22petrol%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnNfWT67gJMaWiQf02JyRAw\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"%22petrols%22%20-intitle%3A%22petrol%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 149\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"At a crank angle 6° before the TDC, the electric spark ignites the \u0027\u0027petrol\u0027\u0027 mixture\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 February 10, \u0027Kenya Gazette\u0027, %22petrols%22+-intitle:%22petrol%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnNfWT67gJMaWiQf02JyRAw\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"%22petrols%22%20-intitle%3A%22petrol%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 354\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"He also admitted that when big trucks bring in \u0027\u0027petrol\u0027\u0027, they park along Langata Road\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 August, \u0027Economic Scenario\u0027, \u0027w:Pratiyogita Pratiyogita Darpan\u0027, %22petrols%22+-intitle:%22petrol%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnNfWT67gJMaWiQf02JyRAw\u0026amp;redir_esc\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"%22petrols%22%20-intitle%3A%22petrol%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 218\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The increase in rates comes just a few days after India raised \u0027\u0027petrol\u0027\u0027 prices by 9-2% and diesel prices by 6-6% which boosed inflation expectations in Indian economy\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Robin Stonecash, Joshua Gans, Stephen King, Gregory Mankiw, \u0027Principles of Macroeconomics\u0027, Cengage Learning Australia, %22petrols%22+-intitle:%22petrol%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dnNfWT67gJMaWiQf02JyRAw\u0026amp;redir_esc\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"%22petrols%22%20-intitle%3A%22petrol%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 122\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Most major Australian cities receive their \u0027\u0027petrol\u0027\u0027 from a single refinery\", \"priority\":19}]}, \"synonyms\":{}}");

	add("petroleum", "{\"term\":\"petroleum\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"English\"], \"text\":\"From \u0027petroleum\u0027 from \u0027petra\u0027 (rock) + \u0027oleum\u0027 (oil)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flammable liquid ranging in color from clear to very dark brown and black, consisting mainly of hydrocarbons, occurring naturally in deposits under the Earth\u0027s surface\", \"priority\":1}]}, \"synonyms\":{}}");

