	add("petticoat", "{\"term\":\"petticoat\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{compound|petty|coat|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tight, usually padded undercoat worn by men over a shirt and under the doublet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A woman\u0027s undercoat, worn to be displayed beneath an open gown\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A type of ornamental skirt or underskirt, often displayed below a dress; chiefly in plural, designating a woman\u0027s skirts collectively\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A light woman\u0027s undergarment worn under a dress or skirt, and hanging either from the shoulders or (now especially) from the waist; a kind of slip, worn to make the skirt fuller, or for extra warmth\", \"priority\":4}]}, \"synonyms\":{}}");

	add("pettifogger", "{\"term\":\"pettifogger\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027petty\u0027 + \u0027fogger\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who quibbles over trivia, and raises petty, annoying objections\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1809\u0027\u0027, w:Washington Washington Irving, \u0027Knickerbocker\u0027s History of New York\u0027, ch. 39\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Hence the cunning measure of appointing as ambassador some political \u0027\u0027pettifogger\u0027\u0027 skilled in delays, sophisms, and misapprehensions, and dexterous in the art of baffling argument\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An unscrupulous or unethical lawyer, especially one of lesser skill\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1822\u0027\u0027, w:Walter Sir Walter Scott, \u0027The Fortunes of Nigel\u0027, ch. 11\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"quot;An inn, or a tavern . . . these are places where greasy citizens take pipe and pot, where the knavish \u0027\u0027pettifoggers\u0027\u0027 of the law spunge on their most unhappy victims\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1885\u0027\u0027, \u0027The Bay State Monthly\u0027, Vol. 3, No. 6\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"yet he has never sought by browbeating and other arts of the \u0027\u0027pettifogger\u0027\u0027, to confuse, baffle, and bewilder a witness\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1926\u0027\u0027 June 28, \u0026quot;[http://www.time.com/time/magazine/article/0,9171,846584,00.html National Affairs: Blind Mans Huff],\u0026quot; \u0027Time\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"quot;Donald Hughes, well known in Minneapolis as a conscienceless shyster, was placed in charge of the case. . . . Mr. Edgerton, a high class, reputable lawyer, was called in of counsel from another city to lend respectability to the crooked, unprincipled, blackmailing \u0027\u0027pettifogger\u0027\u0027, Hughes.\u0026quot\", \"priority\":10}]}, \"synonyms\":{}}");

